import React from 'react'

const LibrarySong = ({songs}) => {
    return (
        <div className="library-song">
            <img src={songs.cover} alt={songs.name} className="musicCover"/>
            < h2 className = "songName" > {
                songs.name
            } </h2>
            <h3>{songs.artist}</h3>
        </div>
    )
}

export default LibrarySong
